    false,nt"url": null,nt"notes": "This narrative report for National Elk
    Refuge outlines Refuge accomplishments from May through August of 1961. The report
    begins by summarizing the weather conditions, habitat conditions, and water conditions
    during this period. Wildlife- including migratory birds, upland game birds, big
    game animals, furbearers, predators, rodents, raptors, and fish- is also covered.
    The Refuge development and maintenance section discusses physical developments,
    plantings, and wildfires. Resource management is outlined; topics include grazing.
    A progress report on field investigations and applied research is also provided.
    The public relations section discusses recreational uses, Refuge visitors, and Refuge
    participation. Items of interest, N-R forms, and photographs are attached.",nt"owner_org":
